CREATE TABLE "layers" ("_id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,"name" TEXT NOT NULL);
CREATE TABLE "placemarks" ("_id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,"description" TEXT NOT NULL,"type" TEXT NOT NULL,"longitude" REAL NOT NULL,"latitude" REAL NOT NULL,"heading" INTEGER,"range" INTEGER,"layer_id" INTEGER NOT NULL, FOREIGN KEY(layer_id) REFERENCES layers(_id));
